import React from "react";
import theme from "./theme";
import "./App.css";
import { ThemeProvider } from "theme-ui";

function App() {
  return (
    <ThemeProvider theme={theme}>
      <div className="App">
        <p>personal website</p>
      </div>
    </ThemeProvider>
  );
}

export default App;
